import Leaflet from 'leaflet'
import React, { StrictMode } from 'react'

Leaflet.Icon.Default.imagePath =
  '//cdnjs.cloudflare.com/ajax/libs/leaflet/1.3.4/images/'

import CustomComponent from './Components/custom-component';



function App() {
  return (
    <StrictMode>
        <CustomComponent/>

        </StrictMode>
  );
}

export default App;


